(2137, 1, 'Arts & Entertainment', 'arts-entertainment', '354708328_1662711683.jpg', NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Look out for some of the best events near you, with Local Tales. If you\'re looking for a day outing for the family, unique date night ideas, or even something new to experience on your own, we have it covered. Our current Arts and Entertainment guide will introduce you to new hobbies and interests that you might have never considered before.</span></p>', '<p><span style=\"font-weight: 400;\">Do you find yourself bored with the same old activities? Not to worry, because our Local Tales Arts and Entertainment page will help you branch out and experience all of the new events and locations in your area. Whether </span><span style=\"font-weight: 400;\">you are looking for a fun zoo day with the family, the hottest new nightclub for partiers, or an exciting amusement park for the thrill seekers, Local Tales has all of the information you could ever want. Not only will we share all of the local events in your area, but we also have the best deals to help you enjoy them. We will find and share the top-rated activities so you don\'t have to!</span></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, NULL, '2022-09-22 08:54:55'),
(2138, 1, 'Accommodation', 'accommodation', '1538755868_1662712022.jpg', NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Explore a range of different accommodations on Local Tales, from hotels to housing, we want to help you find the right accommodation for your needs. If you are searching for an adventurous and fun caravan park, the perfect hotel for one night away, or a vacation home that sweeps you away from reality, then this is the place for you.&nbsp;</span></p>', '<p><span style=\"font-weight: 400;\">Looking for a place to stay? Whether you&rsquo;re looking for a long-term, short-term, or anything in the middle, Local Tales has an accommodation guide to suit all walks of life. We have the best deals on the top-rated </span><span style=\"font-weight: 400;\">accommodations in your area, as well as competitive quotes from local businesses, meaning we do the searching and you do the choosing. Local Tales will make finding accommodation stress-free, and we can provide top-rated options so that you can rest easy. From hotels to villas to residential areas, the options are endless when it comes to hunting for temporary or permanent accommodation with Local Tales.</span></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, NULL, '2022-09-22 15:08:38'),
(2139, 1, 'Agriculture and Mining', 'agriculture-and-mining', '364762815_1662712301.jpg', NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Discover all things agriculture and mining related with our handy Local Tales guide. From supplies to farms to equipment, we have information on everything you could need in your local area. From general needs like greenhouse supplies to more specific things like llama and alpaca breeders, Local Tales has a range of businesses and locations to explore near you.</span></p>', '<p><span style=\"font-weight: 400;\">With our top-rated section, Local Tales is here to help point you in the right direction for all agriculture and mining-related things. Whether it\'s mineral suppliers, livestock buyers, fruit growers, or more, we have </span><span style=\"font-weight: 400;\">something to help. We aim to gather the best deals from local businesses so you can stay local to your area and get the right offers for your needs. Also, with Local Tales, you can research quotes from local suppliers to compare the best choices available. We have a business for you if you need crop dusting, egg farms, or grain storage, as well as a lot more that you can explore with our guide.</span></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, NULL, '2022-09-22 15:09:30'),
(2140, 1, 'Automotive', 'automotive', '1592760831_1662712647.jpg', NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Discover all things automotive in your area with our handy Local Tales guide. From car dealers and mechanics to service stations and parking areas, we want to help you find all of the assistance and help you need. On the Local Tales Automotive guide, you will find a range of information to assist you with all things vehicle-related. </span></p>', '<p><span style=\"font-weight: 400;\">On Local Tales, we want to make sure you are getting the best deals available, so we share the top-rated businesses, locations, and suppliers in your area. This makes the hunting process easier for you and with the variety of suppliers in this guide, we make sure that you can find the best quotes, prices, and products possible. Whether you need to repair a damaged vehicle, shop around for a new car, or even take your current one for a fresh wash, we have got you covered. Not only this but our top-rated local businesses and providers will make sure you get the best value for money among the other competitors in the area.</span></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, NULL, NULL);
