(2141, 1, 'Business Services', 'business-services', '2141029371_1662712818.jpg', NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">For all things business, we have compiled a list of all the different service types you could ever need. With Local Tales, we will share all of the best and most appropriate business services in and around your area, to keep things local and straightforward. Whether it&rsquo;s advertising and marketing or catering and cleaning, we can help you find it.</span></p>', '<p><span style=\"font-weight: 400;\">Within our detailed Business Services Guide, Local Tales will provide you with all the local options, from quality control to accounting and finance, or anything in between. Our top-rated section will show you all of the best businesses, suppliers, and locations, so you can choose the right service for you and your business. We will also gather quotes for bigger products so you can shop around and choose the best deals on offer, making you the chief decision-maker. From design services to legal services, Local Tales will provide you with endless options and top deals - whatever you may need, we will help you find it.</span></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, NULL, NULL),
(2142, 1, 'Adult', 'adult', '1763370930_1663037822.jpg', NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Adults only beyond this point! This section of Local Tales has all you need to know about adult-related services in your area. We have a range of adult novelties and product stores and retailers as well as different types of adult agencies to explore. Take a look at our adults-only guide to see what we have found for you.</span></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 0, NULL, '2022-09-28 12:27:12'),
(2155, 1, 'Domestic Services', 'domestic-services', '2028110947_1664260842.jpg', NULL, NULL, NULL, '<p>Discover a range of domestic services available in and around your area with Local Tales. For all home-related services, we have an extensive guide that covers them all. If you need home cleaning or decor services, repairs, waste control, and more, our Domestic Services guide will have the answer. Check out our list of businesses and services that will help you to cover all bases.<br></p>', '<p>Whether you need a nearby dry cleaner, efficient pest control, indoor and outdoor maintenance, or anything in between, Local Tales has got you covered. We will share the top-rated businesses local to you, and provide you with the best deals for anything domestic-related. Local Tales will also provide quotes from local suppliers so you can be sure you are getting the best offers, such as home improvement or pool maintenance services. For all things in and around your household, our guide will point you in the right direction for any services you could need, all while making sure you are utilizing the top-rated suggestions.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, NULL, '2022-09-27 06:40:42'),
(2156, 1, 'Education & Learning', 'education-learning', '1269665977_1664260785.jpg', NULL, NULL, NULL, '<p>Discover a wide range of education facilities on Local Tales, for all ages and levels of learning. It is never too late to stop learning, and for the little ones, it is one of the most important parts of the early life stages. Local Tales has a detailed guide filled with all types of education in your area, from kindergarten, all the way up to adult education - we leave no one out of the loop.<br></p>', '<p>Are you a new parent looking for the perfect school to enroll your child in? Or are you a student moving to the area for higher education? For extracurricular activities, we’ve got you covered. Local Tales will provide you with the top-rated education facilities in your local area so you can connect with the community and further your own (or somebody else’s) learning. There are so many options to explore with the Local Tales guide, including possibilities like driving schools, tutoring, or even first aid training. We understand how important education is and want to make it easy for you to find the best options in and around your area.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, NULL, '2022-09-27 06:39:45'),
(2157, 1, 'Event Planning', 'event-planning', '717345039_1664261944.jpg', NULL, NULL, NULL, '<p>If you have an important event coming up, we have all the information you could need. From planning a wedding to hosting a fancy dress party, Local Tales has got you covered. Our detailed guide will ensure you have a handy checklist containing all of the details you need to make your event memorable. For the hardcore planners, or the calm and collected, Local Tales will cover all bases for your next event.<br></p>', '<p>Do you have a big occasion coming up? Maybe a special birthday or a family celebration? With Local Tales, we will help you find the best deals from local suppliers. Whether you need event security for a big turnout, or photographers to capture that special moment, we want to make the planning process as easy as possible. Getting quotes from local suppliers could not be easier, leaving you with the best deals for your next big event. Local Tales will also share nearby businesses in your area, so grabbing those last-minute party supplies is a breeze, and those flowers and cakes remain in one piece for the journey home.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, NULL, '2022-09-27 06:59:04'),
(2158, 1, 'Fashion', 'fashion', '965799998_1664260687.jpg', NULL, NULL, NULL, '<p>Explore a range of fashion brands, stores, and retailers with Local Tales, our guide to everything fashion-related in your local area. For every occasion, the Local Tales fashion guide will provide you with new and chic options, including high-end fashion for special events or costume jewelry to switch up now and again. There is something for everyone in our Local Tales fashion guide.<br></p>', '<p>From local businesses to high-end, designer brands, Local Tales will introduce you to all of the trends that can be shopped near you. We have all of the best deals so you know that you are getting only the very best from the top suppliers and fashion retailers. Whether you are more of a thrifter who enjoys a touch of vintage shopping, or you prefer to have the most exclusive, brand-new, luxury items, Local Tales will make sure you can easily find the best locations to shop. The top-rated stores in your town will be shown at the forefront of our guide so you do not have to waste any time looking in the wrong direction.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, NULL, '2022-09-27 06:38:07'),
(2159, 1, 'Financial Services', 'financial-services', '1844187983_1664260641.jpg', NULL, NULL, NULL, '<p>Locate the top financial services in your area, with Local Tales. We have everything you could need in regard to finance, from banks to insurance companies, and a lot more. Local Tales is here to help you feel confident in your financial choices, whether it is as simple as finding a secure ATM, or as detailed as organising car insurance, we want to provide you with a good variety of choices.<br></p>', '<p>Finance is important, especially if you are in charge of multiple finances, so we want to make sure that you can remain safe and secure with the financial choices you make. If you need financial planning or advisors, taxation consultants, loan providers, or anything else, Local Tales will provide the top-rated options available for you. We will also suggest local businesses with the best deals, and we will provide you with quotes from suppliers to make sure that you are confident and content with your financing. Struggle and finance are not two words we want to put together, so with this guide, we will give you the best options to help you make the optimal decisions.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, NULL, '2022-09-27 06:37:21'),
(2160, 1, 'Food & Drink', 'food-drink', '252541119_1664260582.jpg', NULL, NULL, NULL, '<p>Discover the wide range of food and drink options available in and around your local area. With Local Tales, we can help you find the best locations for all types of food and drink. From fresh bakeries and butchers to bustling farmers\' markets, there is something for everyone. We will help you find the best meats, veggies, dairy, and all that comes between, with our detailed Local Tales guide.<br></p>', '<p>Food and drink are something we all have in common, so we are here to help you find the best deals, locations, and suppliers to help suit you. Here you will find a huge range of stores, outlets, and other information that will make finding food and drink easier than ever. Whether you are looking for a small and budding, local business to try out for the first time, or perhaps a new cooking ingredient to add to your pantry, we’ve got you covered. The top-rated places near you will be showcased here on Local Tales, so finding the best food and drink will be a piece of cake!<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, NULL, '2022-09-27 06:36:22'),
(2161, 1, 'Government', 'government', '702215760_1664260339.jpg', NULL, NULL, NULL, '<p>For all things government-related, Local Tales has got a range of information to provide you with all you need. From libraries to prisons, our Local Tales Government guide will share all of the local services and nearby locations for anything under the government sector. We know that navigating government-related issues can be tricky, so that’s why we have created a guide to help you find what you are looking for.<br></p>', '<p>Whether you are in search of the nearby courts, information about the current political parties, or perhaps the local government, Local Tales has a detailed guide to point you in the right direction. We gather the best and top-rated locations and areas, from libraries to other government-related services, so that you can be assured that you are in the best hands. Local Tales is here to provide you with all of the current information on courts, embassies, state government, and more to make it easier for you to understand and access them yourself without doing any of the extra research.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, NULL, '2022-09-27 06:32:19'),
