(2168, 1, 'Health & Medical', 'health-medical', '1619081396_1664260941.jpg', NULL, NULL, NULL, '<p>For all things health-related, Local Tales has constructed a guide of all the local services near you, so finding important information is easy for you. If you are in need of health centres, doctors, dental health, or anything else, we are here to provide you with all of the relevant services in your area.<br></p>', '<p>Local Tales is here to provide you with all of the top-rated, local services for you, whether you require health supplies, a nearby GP, or any other specific medical care, we can help you find it. This guide is here to assist you if you are searching for health and medical services near your location. We know how tricky health and medical services can be, so by providing you with the best options, we hope to make the search easier. From cosmetic surgery to chiropractors to pregnancy services, Local Tales will suggest nothing but the best options for you and ensure that you use the best facilities in your area.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-27 06:42:21', '2022-09-27 06:42:21'),
(2169, 1, 'Home & DIY', 'home-diy', '1329506902_1664261006.jpg', NULL, NULL, NULL, '<p>If you are looking for a way to change up your home interior, start a new DIY project, or grab some household supplies, then look no further. Local Tales has a fully comprehensive Home and DIY guide that will make it easier for you to do all of these things. From home improvements to tools and storage, we will make your DIY process easy and smooth.<br></p>', '<p>It doesn’t matter if you are a skilled interior decorator, or a complete newbie, Local Tales will provide you with all of the top-rated businesses, stores, and suppliers so that you can feel like a professional. We will also share the best deals with you so you can come out the other end with the best quality materials and supplies. With Local Tales, you can also get quotes from local businesses and suppliers so you can plan ahead and get the best help when something is a little too advanced for you to do on your own. For installations, maintenance, construction, and more, we want to leave you in the best hands available.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-27 06:43:26', '2022-09-27 06:43:26'),
(2170, 1, 'Manufacturing & Industrial', 'manufacturing-industrial', '330042585_1664261186.jpeg', NULL, NULL, NULL, '<p>For all things manufacturing, look no further. Whether it’s anything as common as beds, bridal supplies, and clothing, or as random as felt, machinery, and pie makers, we probably have it in our guide. Local Tales has a fully comprehensive and detailed guide to all Manufacturing and Industrial businesses and wholesalers in and around your local area.&nbsp;<br></p>', '<p>Find the top-rated businesses, suppliers, and stores with our Local Tales guide, where we suggest all of the best in the industry so you can keep your search short and sweet. We have a guide that includes anything from air conditioning manufacturers to video equipment wholesalers, so we can cater to absolutely anyone. Local Tales will collect quotes from local suppliers and businesses so that you can compare the best available options for you. Even more, providing you with the best deals from a range of different manufacturers can make narrowing down the search even easier - especially with the huge number of options that are out there.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-27 06:45:58', '2022-09-27 06:46:26'),
(2171, 1, 'Media & Communication', 'media-communication', '1783974958_1664261246.jpg', NULL, NULL, NULL, '<p>Explore a new way to communicate, with a range of media and communication services on Local Tales. Tuning into the most popular radio station is something we are all guilty of, but do you know how many local radio stations there actually are in your area? Local Tales is here to provide you with all of the information about them, and a lot more - everyone should be part of their local community!&nbsp;<br></p>', '<p>In your community, you will find online and printed news, there might be nearby TV studios, and there are post offices you might visit once in a while. Local Tales is here to share all of the best local businesses and services in your area relating to all things media and communication. From the top-rated services to the best secret deals, we have all of the community secrets for you to find out for yourself here with Local Tales. We can also provide you with the best quotes from the top suppliers, so you don’t have to miss out on the greatest deals in the community.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-27 06:47:26', '2022-09-27 06:47:26'),
(2172, 1, 'Parent & Family', 'parent-family', '246367936_1664261299.jpg', NULL, NULL, NULL, '<p>Calling all parents and caregivers, we know how important it is to find the right schools, daycares, and activities for your little ones. Local Tales will help you to explore the best options for the children in your life, whether it is enrolling them in their first nursery, introducing them to enriching, extracurricular activities, or shopping for clothes, we want to help you as much as we can.<br></p>', '<p>To make parenting that little bit easier, we have compiled all of the top-rated schools, stores, and locations in your area, to help relieve some of the stress you’re probably feeling. Local Tales helps keep things local and nearby to you so there is no need to make any unnecessary journeys to get the best deals for your children. We also connect with suppliers and businesses to get the best deals on things like activities, clothes, and more. You can discover the best schools and daycares in your area with Local Tales, giving you the peace of mind that we believe all parents and caregivers truly deserve.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-27 06:48:19', '2022-09-27 06:48:19'),
(2173, 1, 'Pets', 'pets', '1837014801_1664261368.jpg', NULL, NULL, NULL, '<p>Calling all pet parents! For all things pet-related - look no further! We know how much your fur babies mean to you and Local Tales is here to help you find all of the pet-related services you could ever need. Whether you are looking for doggy daycares, catteries, or pet stores, the Local Tales guide will point you in the right direction.<br></p>', '<p>Are you having trouble training your new puppy? Or perhaps going on holiday and need someone to cat-sit or dog-sit? You can find all of the best options for you and your pet on Local Tales. From groomers to vets to pet hotels, you can trust that we have a range of local businesses to lessen the stress that often comes with having a fur baby. With Local Tales, we will help you locate the nearest and most reliable businesses in your area so you and your pet do not have to search far. What’s even better - we will leave you with the best deals and providers so you and your pet can get the best option available.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-27 06:49:28', '2022-09-27 06:49:28'),
(2174, 1, 'Professional Services', 'professional-services', '849076172_1664261423.jpg', NULL, NULL, NULL, '<p>Discover a huge range of professional services near you, with Local Tales. Our Professional Services guide on Local Tales will provide you with lots of information and choice regarding all types of services. From accountants to boutiques to lawyers - you name it, we will likely have it. With all services near to you, Local Tales can share all of the best options for you to hand-pick.<br></p>', '<p>For all of the best and top-rated professional services, Local Tales has got you covered. We will gather all of the relevant local businesses, suppliers, and stores for you to compare and choose from. Whether you need to find a computer repair service for difficult tech, an interior designer to change up your home, a solicitor for legal business, or anything else, Local Tales can help you out. By providing only the best of the best services, we can assure you that you are getting the best value for money and the top-rated services in your area. Check out all of the professional services we have to share with you.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-27 06:50:23', '2022-09-27 06:50:23'),
(2175, 1, 'Religion', 'religion', '1720311973_1664261498.jpg', NULL, NULL, NULL, '<p>Discover all of the different religious organisations and locations near you and around your area. Local Tales has a guide to all of the different religious places of worship and locations for all people. We want to make sure that no matter who you are, you have a space in your area to communicate with others within your religious community, so we have compiled a list of different areas for you to look at.<br></p>', '<p>With Local Tales, we have gathered all of the top-rated religious locations, spots, and places of worship for you to decide what is best suited for you. Whether it is churches, mosques, synagogues, temples, or any other religious organisations you are looking for, we have found the best options in and around your local area for you, your family, or anyone else who may be searching. We can also provide key information on all of the available organisations for you to read for yourself. Check out our top-rated section here on Local Tales to find all of the best religious locations and groups in your community.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-27 06:51:38', '2022-09-27 06:51:38'),
(2176, 1, 'Restaurants', 'restaurants', '210956174_1664261568.jpg', NULL, NULL, NULL, '<p>Discover the best foodie locations in and around your local area, right here. Whether you’re on the hunt for a casual café or a sizzling steak house, Local Tales will point you in the right direction. For vegans, meat lovers, and all that comes in between, our handy guide will provide you with a tasty selection of takeaways and in-house dining from all of your local locations.<br></p>', '<p>Looking for a new spot to eat? You can find a range of local dining spots in your area on Local Tales, with a variety that covers all types of food lovers! Not only that, but we have the best deals for you when it comes to finding food and drink in your area. With a wide range of cuisines on offer, you can find restaurants based on your personal preference with the help of our detailed guide. The top-rated locations in your area will be placed in the spotlight so even the small businesses have a chance to shine!<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-27 06:52:48', '2022-09-27 06:52:48'),
(2177, 1, 'Retail Shopping', 'retail-shopping', '1266668275_1664261627.jpeg', NULL, NULL, NULL, '<p>Discover all of the retail options in your area with our Local Tales guide. We know most of you reading this will love to shop, whether it’s for home accessories, entertainment, food, or anything else, there is something for everyone in our Retail Shopping guide. The options are almost endless and we hope we can share a new store for you to explore.<br></p>', '<p>Shoppers unite, with our top-rated and best deals section, this detailed guide to your local retail stores will introduce you to a whole new world of shopping. Whether you need clothing stores, sporting outlets, toy stores, or shopping centres with all the above and more, we can help you find them. Local Tales will provide the best deals from local businesses, and the highest-rated stores so you can find the best options available. We can also gather quotes from suppliers so you can compare options when it comes to making an investment in something like a motor home. Discovering a new world of retail shopping could never be easier with Local Tales.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-27 06:53:47', '2022-09-27 06:53:47'),
(2178, 1, 'Security & Protection', 'security-protection', '22599227_1664261688.jpg', NULL, NULL, NULL, '<p>Do you need to improve your home security? Or perhaps you need to acquire protective equipment? Local Tales has all of the nearby locations and businesses for you to get whatever you need to improve your security and protection. If you need an alarm system, security cameras, or locks, our guide has got you covered across all bases.<br></p>', '<p>Local Tales is here to provide you with all of the top-rated suppliers, businesses, and stores for all things security and protection. We aim to give you the best options so you feel confident in your choices, whether you need security for the home, workplace, or elsewhere. Safety is a priority for most people, and Local Tales is here to share the top deals on products and systems, as well as collect quotes from local businesses so you can weigh up the best choices while staying local to your area. From child safety seats to emergency lights to smoke detectors, we want to make sure you can find all of the services you need.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-27 06:54:48', '2022-09-27 06:54:48'),
(2179, 1, 'Sports & Leisure', 'sports-leisure', '2018962922_1664261751.jpg', NULL, NULL, NULL, '<p>If you are the type of person that loves to adventure, play, and have fun - then this is the page for you. Our Local Tales Sports and Leisure guide has all of the current sports and activities in your area. Whether you are into surfing, golf, swimming, or anything else sporty, there will be something for you in our extensive guide.<br></p>', '<p>From boxing to fishing, or paintballing to pilates - you name it, there is an activity for anyone. Local Tales aims to show you all of the top-rated sporting and leisurely activities in your area, so you can have endless days of fun. Even more, we have the best deals from different clubs and groups so you can enjoy more for your money. You can compare different offers near you and choose the most suitable activity for a group of friends or just yourself - who says you can’t play solo squash? Whether you want to dive into extreme sports or take it easy with some yoga, Local Tales is here to point you in the right direction.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-27 06:55:51', '2022-09-27 06:55:51'),
(2180, 1, 'Trades', 'trades', '1098966812_1664261799.jpg', NULL, NULL, NULL, '<p>Discover all businesses and trades in your local area with our comprehensive Local Tales Trades guide. From builders to electricians, gardeners to tree surgeons, we truly have it all. Explore all of the many services that are available or on offer near you, and find a tradesperson for any need or want you could have.<br></p>', '<p>Since there are so many services and types of trades (maybe even more than you know), we have compiled a top-rated section that includes all of the best trades and businesses in your local area. Local Tales also will show you the finest deals so you don’t have to worry about missing out. Finding quotes from local suppliers has never been easier with Local Tales, and we assure you that you will find the perfect service for whatever you may need. Whether it is roofing, renovating, guttering, or something different, we will make sure that you get the highest quality business and/or service in town with Local Tales.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-27 06:56:39', '2022-09-27 06:56:39'),
(2181, 1, 'Travel & Transportation', 'travel-transportation', '1190530663_1664261851.jpg', NULL, NULL, NULL, '<p>If you are someone to likes to explore or travel a lot, our Travel and Transportation guide here on Local Tales is worth checking out. Choosing an airline, renting a car, or hiring a campervan has never been easier with Local Tales. Whether you need travel information for daily life or you’re planning your next vacation, we can help you out by sharing all of the available travel and transportation options.<br></p>', '<p>If you need to catch a bus or want to travel in style with a chic limo, check out this guide. From airports to harbours, Local Tales has all of the travel options for you. We also share the top-rated businesses and locations, such as taxis, tourist attractions, or travel agents. Local Tales will also get you the best deals and quotes from suppliers, providers, and businesses, to make the travel experience more enjoyable for everyone. We want to encourage travel and tourism, so this guide is here to share the greatest options in and around your area - or if you do happen to travel, you can check up on all the best deals in each location you visit.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-27 06:57:31', '2022-09-27 06:57:31'),
(2182, 1, 'Utilities', 'utilities', '1276270286_1664261894.jpg', NULL, NULL, NULL, '<p>If you are the one to organise utilities in your home, then listen up - this is for you. On Local Tales, we have created a comprehensive guide to all of the utility services in your area, so being in charge of organising gas, electricity, and water providers is easier than ever. We can’t admit that it’s the most fun thing to do, so allow us to make it simple for you.<br></p>', '<p>Whether you are a homeowner, a tenant, or simply in charge of home utilities, we will share all of the top-rated options in your local area, so this task becomes one bit easier for you. For all electricity, gas, and water suppliers and providers, we will collect the best deals so you to pick from. Local Tales can also gather quotes from local businesses and suppliers so you can be in charge of comparing deals and products. While managing utilities is not the most entertaining job ever, we know that when you are in charge, you will want the best value for your money, and Local Tales is here to provide that for you.<br></p>', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-27 06:58:14', '2022-09-27 06:58:14'),
(2184, 0, 'Accommodation', NULL, NULL, 'Bed & Breakfast', 'bed-breakfast-2', '1254671995_1664349830.jpg', NULL, NULL, NULL, NULL, NULL, NULL, '<p><span id=\"docs-internal-guid-81556a91-7fff-6be5-1c42-846c34202d05\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">For travelers who really long for the homely experience, we have a list of the best bed and breakfasts near you that offer only the full experience. From unique locations to friendly neighbourhoods, there is a range of different options to browse here on Local Tales. Whether you are travelling far or staying close to home, there will be an amazing bed and breakfast for you to try out.</span></span><br></p>', '<p><span id=\"docs-internal-guid-dbddc5a4-7fff-8b3c-1ca2-03276a2c8956\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">By using our guide to bed and breakfasts on Local Tales, you will be able to explore all of the best and top-rated options, locations, and businesses in your chosen area. We can provide quotes from businesses, big or small, so you can compare the best choices for your needs. If you are searching for a simple and straightforwards bed and breakfast, or something more unique and different, there are endless options to explore in this list. Local Tales will also show you all of the best deals so you can get nothing but the top experiences for the absolute best prices.</span></span><br></p>', '', '', NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-28 06:53:39', '2022-09-28 07:23:50'),
(2186, 0, 'Accommodation', NULL, NULL, 'Aged Care', 'aged-care', '560704165_1664349530.jpg', NULL, NULL, NULL, NULL, NULL, NULL, '<p><span id=\"docs-internal-guid-4aa37908-7fff-e2f1-5c09-bdb0f3528263\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Here on Local Tales, we have a list of all the best Aged Care options for yourself or a family member in your area. Finding a suitable home for yourself or your loved one is essential, especially for those who need a bit of extra care, so we want to help you in the search for the best options. </span></span><br></p>', '', '', '<p><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">With our handy Local Tales guide, we will provide you with a complete list of the best, and top-rated aged care homes nearby for you or your loved ones. To ensure that you or your family member can get the best care, in the right location, and with the right people, our list should help you choose the most appropriate home to suit your needs. Whether you are looking for assisted living, a nursing home, or specialist care, Local Tales will have something for you or your loved one. Whatever your needs or preferences are, we want to help you find the perfect home.</span><br></p>', NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-28 07:14:04', '2022-09-28 11:26:18'),
(2187, 0, 'Accommodation', NULL, NULL, 'Caravan Parks', 'caravan-parks', '1677345696_1664350171.jpg', NULL, NULL, NULL, NULL, NULL, NULL, '<p><span id=\"docs-internal-guid-d2d2383d-7fff-905d-60c8-89980cdf0b8a\"></span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Discover all of the best caravan parks in your chosen destination, with bundles of fun for all the family! Whether you are looking for a relaxing but adventurous location, a park with all of the facilities suited for kids, or anything in between, Local Tales will have something for you. Take a look at our caravan park list to help with your next little getaway.</span></p>', '<p><span id=\"docs-internal-guid-625c078e-7fff-9bd2-91ea-e5227276b51c\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">With Local Tales, we will provide you with a selection of the top-rated caravan parks in any area you wish to explore. Planning your next short trip can be made one bit easier with us. We can also show you the best deals and quotes from multiple parks so you can make an informed decision on what will be best for you and your caravanning group. From unique adventures to family fun and activities, Local Tales will help you find a caravan park that meets every need, so you can dive right into the excitement, leaving the stress of searching behind.</span></span><br></p>', '', '', NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-28 07:20:16', '2022-09-28 07:29:31'),
(2188, 0, 'Accommodation', NULL, NULL, 'Guesthouses - Guest Houses', 'guesthouses-guest-houses-2', '124447685_1664512268.jpeg', NULL, NULL, NULL, NULL, NULL, NULL, '<p><span id=\"docs-internal-guid-6e51fbef-7fff-59d1-cffd-6934f24b709c\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Are you and your family or friends looking for a short getaway? Looking for a guesthouse in your chosen destination? Local Tales is here to help! With our comprehensive list of nearby and local guesthouses, planning your next trip away will be easier than ever. From small, cozy homes to larger, extravagant houses, there will be something to suit everyone on this list.</span></span><br></p>', '<p><span id=\"docs-internal-guid-34cb1166-7fff-7eda-f7cb-8552699e06ba\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">For all guesthouses in your chosen location, we will share the best options and top-rated destinations so you can be assured that you make the right choice. To make things even better, Local Tales will also find you the best deals and offers on all of the available guesthouses. From small groups to larger parties, we will help you find the best accommodation to meet your needs for whatever occasion. If you are looking for somewhere with a big garden, somewhere to interact with new people, or anything in between, Local Tales will be here to point you in the right direction.</span></span><br></p>', NULL, NULL, NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-30 04:31:08', '2022-09-30 04:31:08'),
(2189, 0, 'Accommodation', NULL, NULL, 'Hostels', 'hostels', '591102350_1664512470.jpeg', NULL, NULL, NULL, NULL, NULL, NULL, '<p><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap;\">Calling all budget travellers, check out our list of the best hostels in your chosen area. Hostels are one of the best choices of accommodation for young travellers, extroverts wanting to meet new people, or those on a travel budget. Our Local Tales guide will help you find the right hostel to suit your preferences and needs.</span><br></p>', '<p><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap;\">If you are searching for a top-rated hostel to stay at while travelling, look no further, as Local Tales is here to help. Our complete list will show you all of the available options in your chosen area, whether it is near or far from home, making your stay even easier. Whether you are hoping to meet new friends, or stick to more private accommodation, there will be something for you in this guide. We can also provide the best deals from local and popular businesses, which will suit you whether you are budgeting or not. Check out the range of hostels we have found for you.</span><br></p>', '', '', NULL, 'placeholder-image.png', NULL, NULL, 1, '2022-09-30 04:34:04', '2022-09-30 04:34:30');
